"original": |2-
     Enum values are for use in the protocol.  A user interface will
     provide a mapping between protocol enum values and displayable
     user-friendly words and phrases that are localized to the natural
     language of the user.  While the enum symbols specified in this
     document MAY be displayed to users whose natural language is
     US English, they MAY be mapped to other US English words for
     US English users, since the user interface is outside the scope of
     this document.
"fixed": |-
  Enum values are for use in the protocol.  A user interface will provide a mapping between protocol enum values and displayable user-friendly words and phrases that are localized to the natural language of the user.  While the enum symbols specified in this document MAY be displayed to users whose natural language is US English, they MAY be mapped to other US English words for US English users, since the user interface is outside the scope of this document.
"ko": |-
  열거형 값은 프로토콜에서 사용하기 위한 것입니다. 사용자 인터페이스는 프로토콜 열거형 값과 사용자의 자연 언어로 현지화되어 표시 가능한 사용자 친화적인 단어 및 구문 간의 매핑을 제공합니다. 이 문서에 지정된 열거형 기호는 자연어가 미국 영어인 사용자에게 표시될 수 있지만 사용자 인터페이스는 이 문서의 범위를 벗어나므로 미국 영어 사용자를 위한 다른 미국 영어 단어로 매핑될 수 있습니다.
